router.post('/', function(req, res){
  if(!(req.body.x || req.body.y)){
    return res.json({
      message: 'you need to pass in location',
      error: true
    });
  }
  global.data.push(req.body);
  return res.json({
    message: 'success',
    error: false
  });
});

router.put('/:putx/:puty', function(req, res){


  PythonShell.run('/controllers/data_visualization.py', function (err) {
  if (err) throw err;
    fs.unlink('heat_maps/one.png');
    fs.unlink('heat_maps/two.png');
    fs.unlink('heat_maps/three.png');
    fs.unlink('heat_maps/week.png');
    fs.unlink('heat_maps/month.png');

  var arr = ['one.png', 'two.png', 'three.png', 'week.png', 'month.png'];
  arr.forEach(function(filename){
    fs.move(filename, 'heat_maps/'+filename, function(err){
      if(err){ console.error(err);}
      console.log('moved ' + filename + ' to the /heatmaps directory. ');
    })
  });


    console.log('finished');
  });

  for(var r = 0; r < global.data.length; r++){
    if(global.data[r].x === parseInt(req.params.putx) && global.data[r].y === parseInt(req.params.puty)){
      global.data[r].time.one++;
      return res.json({
        message: '('+global.data[r].x + ',' + global.data[r].y + ') has been incremented',
        error: false
      });
    }
  }
  return res.status(404).json({
    message: "x or y value passed in is out of bounds or is nonexistant",
    error: true
  })
})

